import React, { useState } from "react";
import {
  Form,
  FormGroup,
  Label,
  Input,
  Button,
  Container,
  Alert,
} from "reactstrap";
import { useNavigate } from "react-router-dom";
import img from "../Components/img3.JPG";
import { useLanguage } from "../Store/LanguageContext";

const Feed = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    name: "",
    event: "",
    rating: 0,
    comments: "",
  });
  const [submitted, setSubmitted] = useState(false);
  const [adminMenuOpen, setAdminMenuOpen] = useState(false);
  const { lang } = useLanguage();

  const toggleAdminMenu = () => {
    setAdminMenuOpen(!adminMenuOpen);
    navigate("/admin");
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData);
    setSubmitted(true);
    setFormData({
      name: "",
      event: "",
      rating: 0,
      comments: "",
    });
  };

  const t = {
    en: {
      title: "Event Feedback Form",
      name: "Name",
      event: "Event Name",
      rating: "Rating",
      comments: "Comments",
      submit: "Submit",
      thankYou: "Thank you for your feedback!",
    },
    ar: {
      title: "ŸÜŸÖŸàÿ∞ÿ¨ ÿ™ŸÇŸäŸäŸÖ ÿßŸÑŸÅÿπÿßŸÑŸäÿ©",
      name: "ÿßŸÑÿßÿ≥ŸÖ",
      event: "ÿßÿ≥ŸÖ ÿßŸÑŸÅÿπÿßŸÑŸäÿ©",
      rating: "ÿßŸÑÿ™ŸÇŸäŸäŸÖ",
      comments: "ŸÖŸÑÿßÿ≠ÿ∏ÿßÿ™",
      submit: "ÿ•ÿ±ÿ≥ÿßŸÑ",
      thankYou: "ÿ¥ŸÉÿ±Ÿãÿß ŸÑŸÖŸÑÿßÿ≠ÿ∏ÿßÿ™ŸÉ!",
    },
  };

  return (
    <div
      style={{
        background: "linear-gradient(135deg, #1e3c72, #2a5298)",
        minHeight: "100vh",
        padding: "3rem 1rem",
        position: "relative",
        fontFamily: "Arial, sans-serif",
        color: "#333",
      }}
    >
      {/* ÿ≤ÿ± ÿßŸÑÿØÿÆŸàŸÑ ÿßŸÑÿ•ÿØÿßÿ±Ÿä */}
      <Button
        onClick={toggleAdminMenu}
        style={{
          position: "fixed",
          top: "15px",
          right: "15px",
          backgroundColor: "transparent",
          border: "2px solid #fff",
          color: "#fff",
          borderRadius: "30px",
          padding: "6px 15px",
          zIndex: 1000,
          fontWeight: "bold",
        }}
      >
        üîê Admin
      </Button>

      {/* ÿßŸÑÿ¥ÿπÿßÿ± */}
      <img
        src={img}
        alt="Logo"
        style={{
          maxWidth: "140px",
          display: "block",
          margin: "0 auto 1.5rem",
          borderRadius: "20px",
          boxShadow: "0 0 10px rgba(0,0,0,0.2)",
        }}
      />

      {/* ŸÜŸÖŸàÿ∞ÿ¨ ÿßŸÑÿ™ŸÇŸäŸäŸÖ */}
      <Container
        style={{
          backgroundColor: "rgba(255, 255, 255, 0.97)",
          padding: "2rem",
          borderRadius: "25px",
          maxWidth: "600px",
          boxShadow: "0px 5px 15px rgba(0,0,0,0.2)",
          animation: "fadeIn 1s ease-in-out",
        }}
      >
        <h2 className="text-center mb-4">{t[lang].title}</h2>
        {submitted && (
          <Alert color="success" style={{ animation: "fadeIn 1s" }}>
            {t[lang].thankYou}
          </Alert>
        )}
        <Form onSubmit={handleSubmit}>
          <FormGroup>
            <Label for="name">{t[lang].name}</Label>
            <Input
              type="text"
              name="name"
              id="name"
              value={formData.name}
              onChange={handleChange}
              required
            />
          </FormGroup>
          <FormGroup>
            <Label for="event">{t[lang].event}</Label>
            <Input
              type="text"
              name="event"
              id="event"
              value={formData.event}
              onChange={handleChange}
              required
            />
          </FormGroup>
          <FormGroup>
            <Label for="rating">{t[lang].rating}</Label>
            <Input
              type="select"
              name="rating"
              id="rating"
              value={formData.rating}
              onChange={handleChange}
              required
            >
              <option value="">Select Rating</option>
              {[1, 2, 3, 4, 5].map((val) => (
                <option key={val} value={val}>
                  {val}
                </option>
              ))}
            </Input>
          </FormGroup>
          <FormGroup>
            <Label for="comments">{t[lang].comments}</Label>
            <Input
              type="textarea"
              name="comments"
              id="comments"
              value={formData.comments}
              onChange={handleChange}
              rows={4}
            />
          </FormGroup>
          <Button color="primary" type="submit" block>
            {t[lang].submit}
          </Button>
        </Form>
      </Container>

      {/* ÿ™ÿ£ÿ´Ÿäÿ± ÿßŸÑÿ≠ÿ±ŸÉÿ© */}
      <style>
        {`
          @keyframes fadeIn {
            0% { opacity: 0; transform: translateY(10px); }
            100% { opacity: 1; transform: translateY(0); }
          }
        `}
      </style>
    </div>
  );
};

export default Feed;
